function parseLrsDate(v) {
  const year = v.substring(0, 4);
  const month = v.substring(4, 6);
  const day = v.substring(6);
  return new Date(...[year, month, day].map((s, i) => {
    // Trim off leading zeroes.
    s = s.replace(/^0+(?=[123456789])/, "");
    // Parse string to int.
    let value = parseInt(s);
    // Return the parsed int. Subtract one from the month element because
    // of the stupid way the JavaScript Date constructor works,
    // where the month -- AND ONLY THE MONTH -- is zero-based.
    return i === 1 ? value - 1 : value;
  }));
}; return parseLrsDate

function reviver(k, v) {
  if (k.endsWith("Date") && typeof v === "string") {
    return parseLrsDate(v);
  }
  return v;
}
